import React, { Component } from 'react'

export default class Snap extends Component {
    state= {
        Snap: null,
    }

    componentDidMount() {
        this.setState({Snap: require('snapsvg')})
    }

    SnapSelect = () => {
        return this.state.Snap.select()
    }
    UseSnap = () => {
        return this.state.Snap
    }

}
